import { Button, Form, Input } from "antd";

import { IUpdatePermissionType } from "@shared/interfaces";

interface IInitialValues {
	title: string
}

interface IFProps {
	initialValues?: IInitialValues
	onFinish?: (values: IUpdatePermissionType) => void
	isLoading?: boolean
}


const PermissionTypeUpdateForm: React.FC<IFProps> = ({ initialValues, onFinish, isLoading }) => {

	return (
		<Form
			size="middle"
			layout="vertical"
			initialValues={initialValues}
			onFinish={onFinish}>
			<Form.Item
				label="Tile"
				name="title">
				<Input defaultValue={initialValues?.title} />
			</Form.Item>


			<Form.Item>
				<Button loading={isLoading} type="primary" htmlType="submit">
					Submit
				</Button>
			</Form.Item>
		</Form>
	);
};

export default PermissionTypeUpdateForm;
